import { Navigate, Outlet } from "react-router-dom";

export const PrivateRoutes = () => {
	const user = null;

	if (user) {
		return <Outlet />;
	} else {
		return <Navigate to={"/login"} />;
	}

	return user ? <Outlet /> : <Navigate to={"/login"} />;
};
